import React, { Component } from 'react';

class SearchResult extends Component {
    checkResult( thumbnail) {
        if ( thumbnail) {
            return (
                <div>
                    <br /><br />
                    {/* <h4>{title}</h4> */}
                    <img src={thumbnail} alt="/" />
                </div>
            )
        }
    }
    render() {
        return (
        <div>{this.checkResult(this.props.thumbnail)}</div>
        );
    }
}

export default SearchResult;
